      user: {
        email: "",
        firstName: "",
        lastName: "",
        authed: true,
        authToken: "test"
      }
    }
  }

  render() {

    console.log((!this.state.user.authed && this.state.user.authToken != null));

    return (

      <div className="App">
        {(this.state.user.authed || this.state.user.authToken === null) ? <AppContents /> : <LoginPropmpt /> }
      </div>
    );
  }
}

export default App;
